import React from "react";
import { useSelector } from "react-redux";
import { Navbar, Nav, NavDropdown, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
// import "./NavbarHeader.css"

const NavbarHeader = () => {
  const { user } = useSelector((state) => state.auth);
  const userName = " Hi, " + user.firstName;
  console.log("NAV");
  console.log(user.role);

  return (
    <div id="navbarHeader">
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Button variant="outline-secondary" as={Link} to="/home">
          <i className="bi bi-house-fill"></i>
        </Button>
        &nbsp;
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/clients">
              Clients
            </Nav.Link>
            <Nav.Link as={Link} to="/projects">
              Projects
            </Nav.Link>
            <Nav.Link as={Link} to="/expenseEntries">
              Expenses
            </Nav.Link>
            <Nav.Link as={Link} to="/employees">
              Employees
            </Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link as={Link} to="">
              <i class="bi bi-gear"></i> Admin Options
            </Nav.Link>
            {/* <Nav.Link as={"div"}><i class="bi bi-person-circle" style={{"color": "grey"}}></i></Nav.Link> */}
            <NavDropdown title={<><i class="bi bi-person-circle" style={{"color": "grey"}}></i>{userName}</>} id="collapsible-nav-dropdown">
              {/* <NavDropdown.Item as={Link} to="">
                Action1
              </NavDropdown.Item>
              <NavDropdown.Item as={Link} to="">
                Action2
              </NavDropdown.Item>
              <NavDropdown.Item as={Link} to="">
                Action3
              </NavDropdown.Item> */}
              <NavDropdown.Divider />
              <NavDropdown.Item as={Link} to="/logout">
                Log Out
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default NavbarHeader;
